var tipuesearch = {"pages": [{'title': 'ABOUT', 'text': '40823116 四設計二甲\xa0 江東祐 \n 網頁\xa0 https://40823116.github.io/cd2021/content/index.html \n 倉儲\xa0 https://github.com/40823116/cd2021 \n \n', 'tags': '', 'url': 'ABOUT.html'}, {'title': 'W2', 'text': '由另一位組員構思主題，最後訂定為自動寵物飼料機，並且由我繪製後半部分及修改。 \n Inventor2017自動寵物飼料機 \n \n https://drive.google.com/file/d/1lA8aTwoB9qaprvF4VHMq7TYMH2LgLTIg/view?usp=sharing \n', 'tags': '', 'url': 'W2.html'}, {'title': 'W3', 'text': '使用coppeliasim進行模擬，在過程中產生了幾個問題與改良機會。 \n 在上方攪拌器中的攪拌片一開始的表現就較為不理想，一次性地將過多的飼料撥入槽內，使的部分飼料卡在孔隙，於是我們進行了夏墅的變更。 \n \n 初步建模時的攪拌片，旋轉時會會不太穩定，在後來的改動中，中間連結一個套筒，底部加裝幾個齒，且增加為六片，模擬起來也較為順暢。 \n \n 在運輸終點的飼料盆，也發現了可以改良的機會。 \n 初步建模用了較大的圓角，目的為防止寵物被盆口刮傷，模擬後卻因為前方檔片過低，飼料會滑出槽外，所以把原角的直徑縮小，既不會使寵物受傷，也變相提高檔片的高度。 \n', 'tags': '', 'url': 'W3.html'}, {'title': 'W4', 'text': '在最後的一周，我在成品的外觀上添加一些裝飾，希望能達到吸引目光的效果。 \n \n 花紋設計 \n 還有加裝一個蓋子，不讓寵物直接取得食物。 \n', 'tags': '', 'url': 'W4.html'}, {'title': 'W5-W6', 'text': '組員增加至4人，並使用heroku \n', 'tags': '', 'url': 'W5-W6.html'}, {'title': 'W7-W8', 'text': '\n', 'tags': '', 'url': 'W7-W8.html'}]};